import React from "react";
import "bootstrap/dist/css/bootstrap.css";

const NavBar = () => {
  return (
    <nav className="navbar fixed-top navbar-light bg-light mx-auto">
      <a className="navbar-brand mx-auto">Traffic Playback</a>
    </nav>
  );
};

export default NavBar;
